  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Hawaii's ALOHA (\"A Long-term
  Oligotrophic Habitat Assessment\") Cabled Observatory (ACO) is located 100 km north
  of the island of Oahu, Hawaii (22 45'N, 158W) in the North Pacific Ocean. It provides
  real-time oceanographic observations from a depth of about 4,800 m via a submarine
  fiber optic cable that comes ashore at Makaha on Oahu. This data set provides measurements
  of ocean current velocity at the ACO from a 250 kHz SonTek acoustic doppler current
  profiler (ADCP) at 1.83 m above the ocean bottom. Velocities are flagged bad if
  the amplitude is excessively low or high. An amplitude is high if it exceeds the
  average of the ping before and the ping after by 20 counts. An amplitude is low
  if less than 6 counts. After this the velocities are flagged bad if the absolute
  deviation of the vertical velocity from its ensemble median exceeds 0.15 m/s or
  if its value is less than -0.25 m/s.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
